How to track progress in MongoDB Realm on initial sync?<p>I'm planning to develop a Windows application with an offline-first approach. I found MongoDB Realm with the .Net SDK that seems to suit my requirements. Currently I'm trying to find out how I can track the upload/download progress when connecting to the server database (especially for the first time).</p>
<p>I connect like this:</p>
<pre><code>config = new SyncConfiguration(&quot;myPart&quot;, user); 
var realm = await Realm.GetInstanceAsync(config);
</code></pre>
<p>Then I found this snippet in the Realm documentation to track for example the download-progress:</p>
<pre><code>var token = session.GetProgressObservable(ProgressDirection.Download, ProgressMode.ReportIndefinitely)
                   .Subscribe(progress =&gt;
                   {
                       if (progress.TransferredBytes &lt; progress.TransferableBytes)
                       {
                           // Show progress indicator
                       }
                       else
                       {
                           // Hide the progress indicator
                       }
                   });
</code></pre>
<p>The problem for me is, that I need to have a session-handle to subscribe to the progress event. But I can get the session only after I opened the realm (with <code>realm.GetSession()</code>). And as I open the realm async I will not get the realm before <code>Realm.GetInstanceAsync(config)</code> is completed, which makes the progress-tracker useless.</p>
<p>What can I do to get the progress during the sync? Thank you</p>

