How to get rid of an additional key added while inserting a nested struct in mongodb<p>Suppose this is my struct definition,</p>
<pre class="lang-golang prettyprint-override"><code>type partialContent struct {
  key   string   `json:&quot;key&quot; bson&quot;key&quot;`
  value string   `json:&quot;value&quot; bson:&quot;value&quot;`
}

type content struct {
  id string `json:&quot;id&quot; bson:&quot;_id,omitempty&quot;`
  partialContent
}
</code></pre>
<p>While storing the <strong>content</strong> in MongoDB, it gets stored as</p>
<pre class="lang-json prettyprint-override"><code>{
  &quot;_id&quot;: ObjectID,
  &quot;partialcontent&quot;: {
    &quot;key&quot;: &quot;...&quot;,
    &quot;value&quot;: &quot;...&quot;
  }
}
</code></pre>
<p>But the JSON unmarshal returns</p>
<pre class="lang-json prettyprint-override"><code>{
  &quot;_id&quot;: ObjectID,
  &quot;key&quot;: &quot;...&quot;,
  &quot;value&quot;: &quot;...&quot;
}
</code></pre>
<p>How do I get rid of the additional key <strong>partialcontent</strong> in MongoDB?</p>

