<p>Balance is an array of objects, with balanceDate and newBalance in them. Limit is just a number.</p>
<p>When a user posts an update, what I want to do is push another entry onto the balance array (so create another object), and update the limit.</p>
<p>However, every time I post the edit, it completely replaces the balance object, and doesn't push a new entry on. It does however update the limit fine.</p>
<p>I'm not sure what I'm doing wrong, so some advice would be appreciated.</p>
